import React from "react";
import web from "../src/images/img2.jpg";


const Home = () => {
  return (
    <section  className="home-section">
      <div className="container">
       
          {/* Text and button on the left side */}
          <div className="col-md-6">
            <div className="text-container">
              <h1 className="main-heading">
                Grow Your Business with 
                <strong className="brand-name">Me</strong>
              </h1>
              <h2 className="sub-heading">It's just my project</h2>
              <div className="btn-container">
                <a href="www.google.com" className="btn-get-started">
                  Get Started
                </a>
              </div>
            </div>
          </div>

          {/* Image on the right side */}
          <div className="col-md-6 img-container">
            <img src={web} className="img-fluid animated-image" alt="home img" />
          </div>
        </div>
      
    </section>
  );
};

export default Home;
